protected boolean lessThan(Object a, Object b) {
    Object[] aa = (Object[]) a;
    Object[] bb = (Object[]) b;
    Float fa = (Float) aa[2];
    Float fb = (Float) bb[2];
    return fa.floatValue() > fb.floatValue();
}

